css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("threejs.org") {
  body, #panel {
    background: #000;
    color: #CCA;
  }
  a {
    color: #7AF;
  }
  h1 {
    color: #CCC;
  }
  h2 {
    color: #AF9;
  }
  h3 {
    color: #FFF;
  }
  strong {
    color: #FFF;
  }
  pre.prettyprint, code.prettyprint {
    background: #222;
  }
  pre .pln, code .pln {
    color: #CCC;
  }
  pre .lit, code .lit {
    color: #F99;
  }
  pre .typ, code .typ {
    color: #9BF;
  }
  #filterInput {
    background: #111;
    color: #CCC;
  }
  .tag {
    color: #88F;
  }
  .atn {
    color: #F9F;
  }
}
